	["characters"] = {{["mal_id"] = 2802,   ["firstname"] = "Ashitaka", ["lastname"] = "Ashitaka",  ["nicknames"] = {  "Ashitaka", }, ["description"] = "A prince of the Emishi tribe, Ashitaka is cursed in combat with a demonic boar. His only hope for a cure is to return to the forested land from which the boar-god originally came and discover what rage infected it. Leaving his people behind forever, he makes that journey and discovers the gods of the forest at war with the humans in a iron-mining town. Ashitaka vows to help the two sides reach a compromise, to cure them of the very anger that now eats away at him. The key to compromise appears to lie with a mysterious human girl who lives amongst the gods.",}, {["mal_id"] = 2727,   ["firstname"] = "San", ["lastname"] = "San",  ["nicknames"] = {  "San \"Mononoke Hime (Princess Mononoke)\"", }, ["description"] = "San is known as Princess Mononoke, the 17-year-old girl, princess of spirits and beasts. When San was a baby, her parents, along with some other travelers, were attacked by the wolf goddess Moro. Her parents threw San to Moro as a sacrifice to save their own lives, thus escaping while Moro was preoccupied with San. \n However, San was spared; Moro did not eat her, instead raising San as her own daughter. San treats Moro as her mother and her two natural pups as brothers. San rejects her own humanity, thinking of herself as a wolf. Possibly because of her past, San hates humans with a great ferocity, even more so than Moro. She wears a coat made of wolf hide, and carries a dagger made from the tooth of a wolf.\n \n San cares very much for the forest she lives in and the animals she lives with. San is very agile, able to dodge arrows, darts, and even ishibiya shots. She, like the Mountain Spirits, wants to destroy the humans so that they will stop taking away all their land. She personally wants to kill Eboshi, the leader of Irontown.\n\n",}, {["mal_id"] = 11364,   ["firstname"] = "Gonza", ["lastname"] = "Gonza", 